🥣 Para Massa usei
3 Ovos
1 Xícara de chá cheia de accar (usei só meia para não ficar muito doce)
1/2 Xícara de óleo ou duas colheres de manteiga (usei manteiga)
1 e 1/2 Xícara de leite 
2 Xícaras de farinha de trigo
3 Colheres de sopa de chocolate em pó 
1 Colher de sopa de fermento para bolo.
Bater tudo e colocar numa forma untada com manteiga e farinha.
Coloque colheradas de recheio por cima em toda volta do bolo (ver passo a passo nos destaques)
Assar em forno pré aquecido a 200 graus por 25 minutos dependendo da forma e do forno.
🥣 Para o recheio usei
1 Caixa de creme de leite 
1 Caixa de leite condensado 
100 gramas de coco ralado
Levei ao fogo até engrossar (não pode parar de mexer se não gruda no fundo e queima)
🥣 Para calda usei
1 Caixa de leite condensado 
1 Caixa de creme de leite 
3 Colheres de sopa de chocolate em pó 
Levar ao fogo até o ponto de brigadeiro médio (nem ralo e nem grosso demais)
